        axios.get('http://localhost:5000/api/Consulta/'+parseJwt().jti)

        .then(resposta => resposta.json())

        .then(data => this.setState({ listaConsultas : data }))

        .catch( (erro) => console.log(erro) )
    };

    componentDidMount(){
        this.buscarCunsultas();
    };

    render(){
        return(
            <div>
                <Cabecalho/>
                <body>
                    <section class="container">
                        <div class="alinharTextoMedico">
                            <h1>Entrou como: Prontuario</h1>
                            <button class="botaoLogin">Aualizar Lista</button>
                        </div>
                        <div class="alinharTabela">
                            <div class="tabMedico"> 
                                <table class="tabela">
                                    <thead>
                                        <tr>
                                            <th>Medico</th>
                                            <th>Data</th>
                                            <th>Situação</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {
                                            this.state.listaConsultas.map( (consultas) => {

                                                return(
                                                <tr key={consultas.idConsultas}>
                                                        <td>{consultas.idMedicosNavigation.nome}</td>
                                                        <td>{consultas.DataConsulta}</td>
                                                        <td>{consultas.idSituacaoNavigation.situacao1}</td>
                                                </tr>
                                                )
                                            })
                                        }
                                    </tbody>
                                </table>
                            </div>
                        </div>
                    </section>
                </body>
                <Rodape/>
            </div>
        )
    }
}

export default PagProntuarios
